import React from "react";
import LayoutMovies from '../../components/layout/index';
import {Row, Col, Input} from 'antd';

const {Search} = Input;

const SearchMovies = () => {
    return (
        <LayoutMovies>
            <Row>
                <Col span={24}>
                <Search
                    placeholder="input search text"
                    allowClear
                    enterButton="Search"
                    size="large"
                    onSearch={onSearch}
                    />
                </Col>
            </Row>
        </LayoutMovies>
    )
}
export default React.memo(SearchMovies);
